import React from 'react';
import './index.css';

import { render } from "react-dom";
import {
  FirebaseDatabaseProvider,
  FirebaseDatabaseNode
       } from "@react-firebase/database";
import * as firebase from "firebase/app";
import "@firebase/database";
import { config } from "./config";

const styles = {
  fontFamily: "sans-serif"
};

const s = (a: any) => JSON.stringify(a, null, 2);

class App extends React.Component {
    state = {
      limit: 20
    };
    hitProper = {
      part:  0,
      power: 0,
      long:  0,
      span:  0
    };

    power = {
      Part1: 0,
      Part2: 0,
      Part3: 0,
      Part4: 0,
   }

    destructuring (string) {
      console.log("String"+string);
      if(string!==undefined){
       // console.log('nomer'+string.indexOf(':'));

      if(string.indexOf(':')===0){
        this.hitProper.part=string.slice(1,2);
        this.hitProper.long=string.slice(3,8);
        this.hitProper.power=string.slice(9,13);
      }}
   //   console.log(typeof(this.hitProper.part));
      switch(this.hitProper.part){
        case "1":
            this.power.Part1=this.hitProper.power;
            break;
        case "2":
            this.power.Part2=this.hitProper.power;
            break;
        case "3":
            this.power.Part3=this.hitProper.power;
            break;
        case "4":
            this.power.Part4=this.hitProper.power;
            break;
        default: break;

      }
    }

    render() {
      return (
        <div style={styles}>
          <FirebaseDatabaseProvider firebase={firebase} {...config}>
            <FirebaseDatabaseNode  path="hits/" //  limitToFirst={this.state.limit}
                                   orderByKey  // orderByValue={"created_on"}
                                           >
              {d => {
                const object = d.value;
                let hitData = [];
               // let value=33;
                for(let key in object){
                  hitData.push(object[key].original); 
                          }
                //Object.values(object);
                console.log('check'+hitData[hitData.length-2]);
                this.destructuring(hitData[hitData.length-2]);

                return (
                  <div><p>HI, it's test</p>
                  <img class="fit-picture" 
                       src="../body.png"
                          alt="a" //Grapefruit slice atop a pile of other slices"
                           />
                  <React.Fragment>
                    <pre>Path {d.path}</pre>
                    <pre style={{ height: 500, overflow: "auto" }}>
                      Value {hitData[hitData.length-2]} <br/>
                      Part: {this.hitProper.part}   <br/>
                      Distance: {this.hitProper.long} <br/>
                      Power: {this.hitProper.power} <br/>
                    </pre>
                   {/* <button 
                      onClick={() => {
                        this.setState(state => ({ limit: state.limit + 2 }));
                      }}
                    > 
                      Load more
                    </button> */} 
                  </React.Fragment>
                  <label for="Part1">Hit Part1:</label>
                  <progress id="Part1" max="100" value={this.power.Part1}> {this.power.Part1} % </progress>
                  <label for="Part2">Hit Part2:</label>
                  <progress id="Part2" max="100" value={this.power.Part2}> {this.power.Part2} % </progress>
                  <label for="Part3">Hit Part3:</label>
                  <progress id="Part3" max="100" value={this.power.Part3}> {this.power.Part3} %</progress>
                  <label for="Part4">Hit Part4:</label>
                  <progress id="Part4" max="100" value={this.power.Part4}> {this.power.Part4} %</progress>

                  </div>
                );
              }}
            </FirebaseDatabaseNode>
          </FirebaseDatabaseProvider>
        </div>
      );
    }
  }

render(<App />, document.getElementById("root"));
